{
  "format_version": "1.0",
  "semantic_concepts": {
    "employee_first_name": {
      "concept_description": "The employee's/subscriber's first name or given name",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^[A-Za-z\\\\s\\\\-'\\\\.]+$",
      "examples": [
        "Joshua",
        "Betty"
      ],
      "semantic_variants": [
        "first name", "given name", "emp first name", "employee first name", "subscriber first name"
      ],
      "confidence_boost_keywords": [
        "first", "name", "employee", "subscriber"
      ],
      "exclusion_keywords": [
        "last", "surname"
      ]
    },
    "employee_last_name": {
      "concept_description": "The employee's last name or family name",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^[A-Za-z\\\\s\\\\-'\\\\.]+$",
      "examples": [
        "Miller",
        "Holland"
      ],
      "semantic_variants": [
        "last name", "family name", "emp last name", "employee last name", "subscriber last name"
      ],
      "confidence_boost_keywords": [
        "last", "name", "employee", "subscriber"
      ],
      "exclusion_keywords": [
        "first"
      ]
    },
    "gender": {
      "concept_description": "The employee's gender",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^(M|F|Male|Female)?$",
      "examples": [
        "M",
        "F",
        "Male",
        "Female"
      ],
      "semantic_variants": [
        "gender", "sex", "employee gender", "subscriber gender"
      ],
      "confidence_boost_keywords": [
        "gender", "sex", "employee", "subscriber"
      ],
      "exclusion_keywords": []
    },
    "date_of_birth": {
      "concept_description": "The employee's date of birth",
      "data_type": "date",
      "required": true,
      "validation_pattern": "^(\\\\d{1,2}[/-]\\\\d{1,2}[/-]\\\\d{2,4})$",
      "examples": [
        "08/07/1984",
        "04-22-1985"
      ],
      "semantic_variants": [
        "dob", "birth date", "employee dob", "subscriber dob"
      ],
      "confidence_boost_keywords": [
        "dob", "birth", "employee", "subscriber"
      ],
      "exclusion_keywords": []
    },
    "zip_code": {
      "concept_description": "The zip or postal code for the employee",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^\\\\d{5}(-\\\\d{4})?$",
      "examples": [
        "97210",
        "95310",
        "97007"
      ],
      "semantic_variants": [
        "zip", "zip code", "postal code", "zipcode", "employee zip"
      ],
      "confidence_boost_keywords": [
        "zip", "postal", "code"
      ],
      "exclusion_keywords": []
    },
    "member_type": {
      "concept_description": "Relationship of the row entry to the employee (Employee, Spouse, Child, etc.)",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^(Employee|Spouse|Child\\\\d*?)$",
      "examples": [
        "Employee",
        "Spouse",
        "Child"
      ],
      "semantic_variants": [
        "member type", "relationship", "dependent type", "role"
      ],
      "confidence_boost_keywords": [
        "employee", "spouse", "child", "relationship"
      ],
      "exclusion_keywords": []
    },
    "medical_coverage": {
      "concept_description": "The type or tier of medical coverage elected",
      "data_type": "string",
      "required": true,
      "validation_pattern": "^[A-Z]{1,3}$",
      "examples": [
        "EE",
        "EF",
        "ES",
        "EC"
      ],
      "semantic_variants": [
        "medical coverage", "coverage", "tier", "plan", "medical covg"
      ],
      "confidence_boost_keywords": [
        "medical", "coverage", "tier", "plan"
      ],
      "exclusion_keywords": [
        "dental", "vision"
      ]
    },
    "cobra_status": {
      "concept_description": "Indicates whether COBRA coverage applies",
      "data_type": "string",
      "required": false,
      "validation_pattern": "^(Yes|No)$",
      "examples": [
        "Yes",
        "No"
      ],
      "semantic_variants": [
        "cobra", "cobra status", "cobra election"
      ],
      "confidence_boost_keywords": [
        "cobra"
      ],
      "exclusion_keywords": []
    }
  }
}

{
